// src/components/Home.js
import React from 'react';
import './styles.css'; // Asegúrate de que esta ruta es correcta

const Home = () => {
    return (
        <div className="container">
            <h1>Bienvenido a la Aplicación de Carga de Archivos</h1>
            <button className="button">Carga Reloj</button>
            <button className="button">Carga Horario</button>
            <button className="button" disabled>No Funcional</button>
        </div>
    );
};

export default Home;
